import React from 'react';
import { ListGroup, ListGroupItem } from 'reactstrap';

function DisplayLink(props) {

     if (props.list.length > 0){
         return (
            <ListGroup>
             {props.list}.map((link)=>{

                <ListGroupItem key={link.id}>
                    <a href={link.url}>{link.url}</a>
                </ListGroupItem>

             })
            </ListGroup>
         )
     }

}

export default DisplayLink;
